import React from 'react'
import CardPage from './CardPage'
import Header from './Header'




function Home(props) {
  return (
    <div className='main-home'>
    <Header onSubmit={props.getData}/>
    <CardPage onSubmit={props.getData}/>
    </div>
  )
}
export default React.memo(Home)
